package kandinsky

import (
	"os"
	"testing"
)

var (
	base string = ""
)

func TestAddBase64(t *testing.T) {
	testCases := []struct {
		desc string
		base string
		i    *Image
		want error
	}{
		{
			desc: "successful add base64 to Image",
			i:    new(Image),
			want: nil,
			base: base,
		},
		{
			desc: "empty base64",
			i:    new(Image),
			want: ErrEmptyBase,
			base: "",
		},
		{
			desc: "wrong base64",
			i:    new(Image),
			want: ErrNotBase64Format,
			base: "wrongBase64",
		},
	}
	for _, tC := range testCases {
		t.Run(tC.desc, func(t *testing.T) {
			err := tC.i.AddBase64(tC.base)
			if err != tC.want {
				t.Errorf("\n%s:\n\twant:\n\t\t\"%s\" \n\tgot:\n\t\t\"%s\"\n", tC.desc, tC.want, err)
			}
		})
	}
}

// TestToByte test converting Image instance to byte slice
func TestToByte(t *testing.T) {
	image, err := GetImage(key, secret, params)
	if err != nil {
		t.Errorf("create image error > %s", err)
	}

	emptyImage := new(Image)

	testCases := []struct {
		desc string
		i    *Image
		want error
	}{
		{
			desc: "Successful convert Image to byte",
			i:    image,
			want: nil,
		},
		{
			desc: "Empty Image",
			i:    emptyImage,
			want: ErrEmptyImage,
		},
	}
	for _, tC := range testCases {
		t.Run(tC.desc, func(t *testing.T) {
			b, err := tC.i.ToByte()
			if err == nil {
				if len(b) == 0 {
					t.Errorf("%s: len of byte Image is 0 > %s", tC.desc, err)
				}
			}

			if err != nil {
				if err != tC.want {
					t.Errorf("\n%s:\n\twant:\n\t\t\"%s\" \n\tgot:\n\t\t\"%s\"\n", tC.desc, tC.want, err)
				}
			}
		})
	}
}

// TestToFile test converting Image instance to os.File
func TestToFile(t *testing.T) {
	image, err := GetImage(key, secret, params)
	if err != nil {
		t.Errorf("create image error > %s", err)
	}

	emptyImage := new(Image)

	testCases := []struct {
		desc string
		i    *Image
		want error
	}{
		{
			desc: "Successful convert Image to file",
			i:    image,
			want: nil,
		},
		{
			desc: "Empty Image",
			i:    emptyImage,
			want: ErrEmptyImage,
		},
	}
	for _, tC := range testCases {
		t.Run(tC.desc, func(t *testing.T) {
			f, err := tC.i.ToFile()
			if err == nil {
				stat, err := f.Stat()
				if err != nil {
					t.Errorf("%s: get file stat error 0 > %s", tC.desc, err)
				}
				if stat.Size() == 0 {
					t.Errorf("%s: size of file is 0 > %s", tC.desc, err)
				}
			}

			if err != nil {
				if err != tC.want {
					t.Errorf("\n%s:\n\twant:\n\t\t\"%s\" \n\tgot:\n\t\t\"%s\"\n", tC.desc, tC.want, err)
				}
			}
		})
	}
}

// TestSavePNGTo test saving Image to path/name.png
func TestSavePNGTo(t *testing.T) {
	image, err := GetImage(key, secret, params)
	if err != nil {
		t.Errorf("create image error > %s", err)
	}

	emptyImage := new(Image)

	testCases := []struct {
		desc string
		name string
		path string
		i    *Image
		want error
	}{
		{
			desc: "Successful convert Image to PNG",
			name: "name",
			path: "path/",
			i:    image,
			want: nil,
		},
		{
			desc: "Empty file name",
			name: "",
			path: "path/",
			i:    image,
			want: ErrEmptyFileName,
		},
		{
			desc: "Empty file path",
			name: "name",
			path: "",
			i:    image,
			want: ErrEmptyFilePath,
		},
		{
			desc: "Empty Image instance",
			name: "name",
			path: "path/",
			i:    emptyImage,
			want: ErrEmptyImage,
		},
	}
	for _, tC := range testCases {
		t.Run(tC.desc, func(t *testing.T) {
			err := tC.i.SavePNGTo(tC.name, tC.path)
			ext := ".png"
			if err == nil {
				// check file exists
				if _, err := os.Stat(tC.path + tC.name + ext); err != nil {
					t.Errorf("\n%s:\n\twant:\n\t\t\"%s\" \n\tgot:\n\t\t\"%s\"\n", tC.desc, tC.name, err)
				}
			}

			if err != nil {
				if err != tC.want {
					t.Errorf("\n%s:\n\twant:\n\t\t\"%s\" \n\tgot:\n\t\t\"%s\"\n", tC.desc, tC.want, err)
				}
			}
		})
	}
}

